function randomReserva() {
  let r = [];
  for (let i = 0; i <= ramdomQtd(); i++) {
    r.push(Math.floor(Math.random() * (16 - 1) + 1));
  }
  return r;
}

function ramdomQtd() {
  return Math.random() * (4 - 1) + 1;
}
